  generateCaves() {

    this.grid = [];
    const cellSize = 40; // Size of each grid cell
    this.gridWidth = 72
    this.gridHeight = 167;
    this.WORLD_WIDTH = this.gridWidth * cellSize;
    this.WORLD_HEIGHT = this.gridHeight * cellSize;


    let i = 0;
    // Initialize grid with more open space
    for (let y = 0; y < this.gridHeight; y++) {
      this.grid[y] = [];
      for (let x = 0; x < this.gridWidth; x++) {
        
        this.grid[y][x] = this.data[i++]; 
      }
    }

  }

